import React from 'react';
import HomePage from './pages/HomePage';
import ProductPage from './pages/ProductPage';
import Header from './components/Header';
import Footer from './components/Footer';
import Newsletter from './components/Newsletter';
import CartPage from './pages/CartPage';
// importing data
import items from './data/store-items copy';

import {BrowserRouter, Route, Routes} from "react-router-dom";

class App extends React.Component {
  state = {
    data: items
  }
  render() {
    console.log("9999999999999999");
    console.log(this.state.data);

    return (
      <BrowserRouter>
        <div className="container">
          <Header/>
          <Routes>
            <Route path="/" element={<HomePage items = {this.state.data}/>}/>
            <Route path="/product" element={<ProductPage items = {this.state.data}/>}/>
            <Route path="/cart" element={<CartPage items = {this.state.data}/>}/>
          </Routes>
          <Newsletter/>
          <Footer/>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
